import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router } from 'react-router-dom';

import App from './App';
import Routes from './Routes';

ReactDOM.render(
  <Router>
    <div className="App">
      <App />
      <Router />
    </div>
  </Router>,
  document.getElementById('root')
);
